(2477, 0, 'wlcms_o_welcome_text', '<p><strong>To edit content, you have two choices:</strong>\r\n<br />\r\n1) Click on the \\"Posts\\" link at the upper-left and use the \\"Category\\" filter to find your desired page. From there, almost every page has left, right and bottom content areas.\r\n<br /><br />\r\n2) Since you are logged in, <a href=\\"http://www.insidetsm.com\\" target=\\"_blank\\">visit the site</a> and click on the edit links that correspond to the section you want to edit. Each edit link will be centered under the content area that is able to be modified.\r\n<br /><br />\r\n<strong>Advertising Information:</strong><br />\r\nPublication Ads: 226px × 127px<br />\r\nFooter Ads: 208px × 134px<br />\r\nRate Card: 228px × 82px<br />\r\n</p>', 'yes'),
