(809, 0, '_transient_rss_c1f9d0f400ea517c489d96d6a1de1668', 'O:9:"magpierss":17:{s:6:"parser";i:0;s:12:"current_item";a:0:{}s:5:"items";a:3:{i:0;a:13:{s:5:"title";s:18:"iPhone 4G Wishlist";s:4:"link";s:49:"http://alexrabe.de/2010/01/23/iphone-4g-wishlist/";s:8:"comments";s:58:"http://alexrabe.de/2010/01/23/iphone-4g-wishlist/#comments";s:7:"pubdate";s:31:"Sat, 23 Jan 2010 19:51:40 +0000";s:2:"dc";a:1:{s:7:"creator";s:9:"alex.rabe";}s:8:"category";s:19:"CommonAndroidiPhone";s:4:"guid";s:25:"http://alexrabe.de/?p=581";s:11:"description";s:331:"I&#8217;m using now about two month my iPhone 3GS and it&#8217;s a great experience&#8230;  I need my laptop more than 50 -70% less and it&#8217;s much better than my HTC Magic Android, but there are some minor things which could be better for the next generation :\n\nAdd 1-2 LED&#8217;s for SMS, Email, Low battery or other [...]";s:7:"content";a:1:{s:7:"encoded";s:779:"<p>I&#8217;m using now about two month my iPhone 3GS and it&#8217;s a great experience&#8230;  I need my laptop more than 50 -70% less and it&#8217;s much better than my HTC Magic Android, but there are some minor things which could be better for the next generation :</p>\n<ul>\n<li>Add 1-2 LED&#8217;s for SMS, Email, Low battery or other notification</li>\n<li><a href="http://www.robertsdonovan.com/?p=148">Rework</a> the popup notification for the locked screen</li>\n<li>Add folders to the springboard, we really need them !</li>\n<li>Add a fast scroll down gesture for Safari (For long long comment pages)</li>\n</ul>\n<p>More wishes <a href="http://pleasefixtheiphone.com/">here</a></p>\n<img src="http://feeds.feedburner.com/~r/alexrabe/~4/K6LpDGNPCfg" height="1" width="1"/>";}s:3:"wfw";a:1:{s:10:"commentrss";s:54:"http://alexrabe.de/2010/01/23/iphone-4g-wishlist/feed/";}s:5:"slash";a:1:{s:8:"comments";s:1:"2";}s:7:"summary";s:331:"I&#8217;m using now about two month my iPhone 3GS and it&#8217;s a great experience&#8230;  I need my laptop more than 50 -70% less and it&#8217;s much better than my HTC Magic Android, but there are some minor things which could be better for the next generation :\n\nAdd 1-2 LED&#8217;s for SMS, Email, Low battery or other [...]";s:12:"atom_content";s:779:"<p>I&#8217;m using now about two month my iPhone 3GS and it&#8217;s a great experience&#8230;  I need my laptop more than 50 -70% less and it&#8217;s much better than my HTC Magic Android, but there are some minor things which could be better for the next generation :</p>\n<ul>\n<li>Add 1-2 LED&#8217;s for SMS, Email, Low battery or other notification</li>\n<li><a href="http://www.robertsdonovan.com/?p=148">Rework</a> the popup notification for the locked screen</li>\n<li>Add folders to the springboard, we really need them !</li>\n<li>Add a fast scroll down gesture for Safari (For long long comment pages)</li>\n</ul>\n<p>More wishes <a href="http://pleasefixtheiphone.com/">here</a></p>\n<img src="http://feeds.feedburner.com/~r/alexrabe/~4/K6LpDGNPCfg" height="1" width="1"/>";}i:1;a:13:{s:5:"title";s:17:"Search for Images";s:4:"link";s:48:"http://alexrabe.de/2010/01/13/search-for-images/";s:8:"comments";s:57:"http://alexrabe.de/2010/01/13/search-for-images/#comments";s:7:"pubdate";s:31:"Wed, 13 Jan 2010 22:04:26 +0000";s:2:"dc";a:1:{s:7:"creator";s:9:"alex.rabe";}s:8:"category";s:45:"NextGEN GalleryNextGEN-Gallerysearchsearching";s:4:"guid";s:25:"http://alexrabe.de/?p=566";s:11:"description";s:323:"Many many people requested a search function for NextGEN Gallery. Although a couple of plugins like Search Unleashed crawl already the content of a gallery, the best solution would a list of images as search result. Why is this such a problem for me and not already includes years before ?\nThe search injection is not [...]";s:7:"content";a:1:{s:7:"encoded";s:1588:"<p>Many many people requested a search function for NextGEN Gallery. Although a couple of plugins like <a href="http://urbangiraffe.com/plugins/search-unleashed/">Search Unleashed</a> crawl already the content of a gallery, the best solution would a list of images as search result. Why is this such a problem for me and not already includes years before ?</p>\n<p>The search injection is not that problem, but it needed always a new template or a redirection to a gallery template which maybe doesn&#8217;t fit to your theme layout. I never found the best way, but here is one first try. I&#8217;ve create a small addon plugin. You just need to activate it, it has no parameter or settings.</p>\n<p>Now you must add to your theme the follow function :</p>\n<pre class="brush: html">\n&lt;?php if ( function_exists( &#039;ngg_images_results&#039; ) ) ngg_images_results(); ?&gt;\n</pre>\n<p>This little code return the image search result for the standard search widget from WordPress. Example here : <a href="http://nextgen-gallery.com/?s=cologne">http://nextgen-gallery.com/?s=cologne</a></p>\n<p><strong>UPDATE :</strong> I&#8217;ve a added the search for tags , there are still the issue with the pagination&#8230; but Im working on it.</p>\n<p>You can download the code and a modified search.php for the default theme here :</p>\n<p class="download"><a href="http://nextgen-gallery.googlecode.com/files/nggSearch-v0.6.0.zip">Download NextGEN Search Engine 0.6.0 </a><br />\nTest version @ Google Code</p>\n<img src="http://feeds.feedburner.com/~r/alexrabe/~4/9_Yh_azo8Jw" height="1" width="1"/>";}s:3:"wfw";a:1:{s:10:"commentrss";s:53:"http://alexrabe.de/2010/01/13/search-for-images/feed/";}s:5:"slash";a:1:{s:8:"comments";s:2:"14";}s:7:"summary";s:323:"Many many people requested a search function for NextGEN Gallery. Although a couple of plugins like Search Unleashed crawl already the content of a gallery, the best solution would a list of images as search result. Why is this such a problem for me and not already includes years before ?\nThe search injection is not [...]";s:12:"atom_content";s:1588:"<p>Many many people requested a search function for NextGEN Gallery. Although a couple of plugins like <a href="http://urbangiraffe.com/plugins/search-unleashed/">Search Unleashed</a> crawl already the content of a gallery, the best solution would a list of images as search result. Why is this such a problem for me and not already includes years before ?</p>\n<p>The search injection is not that problem, but it needed always a new template or a redirection to a gallery template which maybe doesn&#8217;t fit to your theme layout. I never found the best way, but here is one first try. I&#8217;ve create a small addon plugin. You just need to activate it, it has no parameter or settings.</p>\n<p>Now you must add to your theme the follow function :</p>\n<pre class="brush: html">\n&lt;?php if ( function_exists( &#039;ngg_images_results&#039; ) ) ngg_images_results(); ?&gt;\n</pre>\n<p>This little code return the image search result for the standard search widget from WordPress. Example here : <a href="http://nextgen-gallery.com/?s=cologne">http://nextgen-gallery.com/?s=cologne</a></p>\n<p><strong>UPDATE :</strong> I&#8217;ve a added the search for tags , there are still the issue with the pagination&#8230; but Im working on it.</p>\n<p>You can download the code and a modified search.php for the default theme here :</p>\n<p class="download"><a href="http://nextgen-gallery.googlecode.com/files/nggSearch-v0.6.0.zip">Download NextGEN Search Engine 0.6.0 </a><br />\nTest version @ Google Code</p>\n<img src="http://feeds.feedburner.com/~r/alexrabe/~4/9_Yh_azo8Jw" height="1" width="1"/>";}i:2;a:13:{s:5:"title";s:53:"How many images do you have in your NextGEN Gallery ?";s:4:"link";s:82:"http://alexrabe.de/2010/01/03/how-many-images-do-you-have-in-your-nextgen-gallery/";s:8:"comments";s:91:"http://alexrabe.de/2010/01/03/how-many-images-do-you-have-in-your-nextgen-gallery/#comments";s:7:"pubdate";s:31:"Sun, 03 Jan 2010 12:51:19 +0000";s:2:"dc";a:1:{s:7:"creator";s:9:"alex.rabe";}s:8:"category";s:46:"NextGEN GalleryNextGEN-GalleryPluginsWordpress";s:4:"guid";s:25:"http://alexrabe.de/?p=554";s:11:"description";s:330:"Happy new year ! A user ask in the forums if there are some limits on the amount of albums/galleries/images. And one user answered that he have\n44467 Images, 1360 Galleries and 72 Albums !!!\nI never tested such an amount of images, but it&#8217;s great that the plugin still works for this purpose&#8230; How many images do [...]";s:7:"content";a:1:{s:7:"encoded";s:941:"<p>Happy new year ! A user ask in the forums if there are some limits on the amount of albums/galleries/images. And one user <a href="http://wordpress.org/support/topic/346780">answered</a> that he have</p>\n<blockquote><p>44467 Images, 1360 Galleries and 72 Albums !!!</p></blockquote>\n<p>I never tested such an amount of images, but it&#8217;s great that the plugin still works for this purpose&#8230; How many images do you have in your gallery ? Are you still satisfied ? What could be optimized ?</p>\n<p>I start to wrote this plugin  just for some personal projects with not more that 1000 images. I know that some features are not really optimized for a high amount of galleries/images (Drag &amp; Drop Album page is not that good for this amount, TinyMCE Button is not usable). anyway I will do my best to optimze this for the future&#8230;</p>\n<img src="http://feeds.feedburner.com/~r/alexrabe/~4/JFuAaTbd_jc" height="1" width="1"/>";}s:3:"wfw";a:1:{s:10:"commentrss";s:87:"http://alexrabe.de/2010/01/03/how-many-images-do-you-have-in-your-nextgen-gallery/feed/";}s:5:"slash";a:1:{s:8:"comments";s:2:"22";}s:7:"summary";s:330:"Happy new year ! A user ask in the forums if there are some limits on the amount of albums/galleries/images. And one user answered that he have\n44467 Images, 1360 Galleries and 72 Albums !!!\nI never tested such an amount of images, but it&#8217;s great that the plugin still works for this purpose&#8230; How many images do [...]";s:12:"atom_content";s:941:"<p>Happy new year ! A user ask in the forums if there are some limits on the amount of albums/galleries/images. And one user <a href="http://wordpress.org/support/topic/346780">answered</a> that he have</p>\n<blockquote><p>44467 Images, 1360 Galleries and 72 Albums !!!</p></blockquote>\n<p>I never tested such an amount of images, but it&#8217;s great that the plugin still works for this purpose&#8230; How many images do you have in your gallery ? Are you still satisfied ? What could be optimized ?</p>\n<p>I start to wrote this plugin  just for some personal projects with not more that 1000 images. I know that some features are not really optimized for a high amount of galleries/images (Drag &amp; Drop Album page is not that good for this amount, TinyMCE Button is not usable). anyway I will do my best to optimze this for the future&#8230;</p>\n<img src="http://feeds.feedburner.com/~r/alexrabe/~4/JFuAaTbd_jc" height="1" width="1"/>";}}s:7:"channel";a:8:{s:5:"title";s:9:"alex.rabe";s:4:"link";s:18:"http://alexrabe.de";s:11:"description";s:32:"ALEX RABE | learning by doing...";s:13:"lastbuilddate";s:31:"Tue, 02 Feb 2010 20:50:09 +0000";s:9:"generator";s:29:"http://wordpress.org/?v=2.9.1";s:8:"language";s:2:"en";s:2:"sy";a:2:{s:12:"updateperiod";s:6:"hourly";s:15:"updatefrequency";s:1:"1";}s:7:"tagline";s:32:"ALEX RABE | learning by doing...";}s:9:"textinput";a:0:{}s:5:"image";a:0:{}s:9:"feed_type";s:3:"RSS";s:12:"feed_version";s:3:"2.0";s:5:"stack";a:0:{}s:9:"inchannel";b:0;s:6:"initem";b:0;s:9:"incontent";b:0;s:11:"intextinput";b:0;s:7:"inimage";b:0;s:13:"current_field";s:0:"";s:17:"current_namespace";b:0;s:19:"_CONTENT_CONSTRUCTS";a:6:{i:0;s:7:"content";i:1;s:7:"summary";i:2;s:4:"info";i:3;s:5:"title";i:4;s:7:"tagline";i:5;s:9:"copyright";}}', 'no'),
