(2686, 0, '_transient_rss_9d9591190fb768987f389ffa4b4942d4', 'O:9:"magpierss":17:{s:6:"parser";i:0;s:12:"current_item";a:0:{}s:5:"items";a:10:{i:0;a:11:{s:5:"title";s:13:"Wordpress 3.0";s:4:"link";s:40:"http://meandmymac.net/939/wordpress-3-0/";s:8:"comments";s:49:"http://meandmymac.net/939/wordpress-3-0/#comments";s:7:"pubdate";s:31:"Tue, 01 Jun 2010 22:37:46 +0000";s:2:"dc";a:1:{s:7:"creator";s:5:"Arnan";}s:8:"category";s:51:"Uncategorized3.0adrotateeventspluginswordpressworks";s:4:"guid";s:40:"http://meandmymac.net/939/wordpress-3-0/";s:11:"description";s:322:"In respons to a support ticket claiming that Events does not work with Wordpress 3.0.\nI&#8217;ve just ran some tests on my test server with a fresh install of Wordpress and an upgrade from 2.9.2. In both cases the Plugins AdRotate and Events worked as advertised and expected. Since the focus of Wordpress 3.0 is NOT [...]";s:3:"wfw";a:1:{s:10:"commentrss";s:45:"http://meandmymac.net/939/wordpress-3-0/feed/";}s:5:"slash";a:1:{s:8:"comments";s:1:"0";}s:7:"summary";s:322:"In respons to a support ticket claiming that Events does not work with Wordpress 3.0.\nI&#8217;ve just ran some tests on my test server with a fresh install of Wordpress and an upgrade from 2.9.2. In both cases the Plugins AdRotate and Events worked as advertised and expected. Since the focus of Wordpress 3.0 is NOT [...]";}i:1;a:11:{s:5:"title";s:12:"Events 2.2.1";s:4:"link";s:39:"http://meandmymac.net/938/events-2-2-1/";s:8:"comments";s:48:"http://meandmymac.net/938/events-2-2-1/#comments";s:7:"pubdate";s:31:"Sun, 30 May 2010 20:58:52 +0000";s:2:"dc";a:1:{s:7:"creator";s:5:"Arnan";}s:8:"category";s:36:"Uncategorizedeventsfixedpluginupdate";s:4:"guid";s:39:"http://meandmymac.net/938/events-2-2-1/";s:11:"description";s:384:"A quick bug fix resulting in you being able to create events again.\nOnly new installs seem to be affected. Cause, a wrong database field. This has been removed and code cleaned up in order to fix the problem.\nThe update is recommended for all users of Events.\nhttp://downloads.wordpress.org/plugin/wp-events.2.2.1.zip\n[Update:]\nFor those who cannot add events or miss options in [...]";s:3:"wfw";a:1:{s:10:"commentrss";s:44:"http://meandmymac.net/938/events-2-2-1/feed/";}s:5:"slash";a:1:{s:8:"comments";s:2:"15";}s:7:"summary";s:384:"A quick bug fix resulting in you being able to create events again.\nOnly new installs seem to be affected. Cause, a wrong database field. This has been removed and code cleaned up in order to fix the problem.\nThe update is recommended for all users of Events.\nhttp://downloads.wordpress.org/plugin/wp-events.2.2.1.zip\n[Update:]\nFor those who cannot add events or miss options in [...]";}i:2;a:11:{s:5:"title";s:10:"Events 2.2";s:4:"link";s:37:"http://meandmymac.net/937/events-2-2/";s:8:"comments";s:46:"http://meandmymac.net/937/events-2-2/#comments";s:7:"pubdate";s:31:"Sat, 29 May 2010 19:13:33 +0000";s:2:"dc";a:1:{s:7:"creator";s:5:"Arnan";}s:8:"category";s:45:"Uncategorizedeventsfixedpluginupdatewordpress";s:4:"guid";s:37:"http://meandmymac.net/937/events-2-2/";s:11:"description";s:339:"At long last, an update. Mostly bug fixes and silliness that&#8217;s got improved. I&#8217;ve decided not to include the calendar view yet. It&#8217;s postponed indefinitely. I found it no improvement at all over how Events is currently. It adds nothing. Perhaps in a later version i&#8217;ll change my mind and think of a better way [...]";s:3:"wfw";a:1:{s:10:"commentrss";s:42:"http://meandmymac.net/937/events-2-2/feed/";}s:5:"slash";a:1:{s:8:"comments";s:1:"0";}s:7:"summary";s:339:"At long last, an update. Mostly bug fixes and silliness that&#8217;s got improved. I&#8217;ve decided not to include the calendar view yet. It&#8217;s postponed indefinitely. I found it no improvement at all over how Events is currently. It adds nothing. Perhaps in a later version i&#8217;ll change my mind and think of a better way [...]";}i:3;a:11:{s:5:"title";s:21:"The gates are closed!";s:4:"link";s:47:"http://meandmymac.net/936/the-gates-are-closed/";s:8:"comments";s:56:"http://meandmymac.net/936/the-gates-are-closed/#comments";s:7:"pubdate";s:31:"Sat, 29 May 2010 11:16:43 +0000";s:2:"dc";a:1:{s:7:"creator";s:5:"Arnan";}s:8:"category";s:35:"Uncategorizedevefungamesgateslocked";s:4:"guid";s:47:"http://meandmymac.net/936/the-gates-are-closed/";s:11:"description";s:270:"So last night in Eve Online, i was going to pick up some modules and gear for my new ship in a usually crowded area of the game. But with the new Expansion it was so crowded that Concord shut down the gates and let people in only 1 by 1.\nSomewhat of a waiting line [...]";s:3:"wfw";a:1:{s:10:"commentrss";s:52:"http://meandmymac.net/936/the-gates-are-closed/feed/";}s:5:"slash";a:1:{s:8:"comments";s:1:"0";}s:7:"summary";s:270:"So last night in Eve Online, i was going to pick up some modules and gear for my new ship in a usually crowded area of the game. But with the new Expansion it was so crowded that Concord shut down the gates and let people in only 1 by 1.\nSomewhat of a waiting line [...]";}i:4;a:11:{s:5:"title";s:21:"Phasing out the forum";s:4:"link";s:48:"http://meandmymac.net/921/phasing-out-the-forum/";s:8:"comments";s:57:"http://meandmymac.net/921/phasing-out-the-forum/#comments";s:7:"pubdate";s:31:"Sat, 15 May 2010 16:21:16 +0000";s:2:"dc";a:1:{s:7:"creator";s:5:"Arnan";}s:8:"category";s:56:"Uncategorizedadrotateeventsforumnewpluginssupporttickets";s:4:"guid";s:48:"http://meandmymac.net/921/phasing-out-the-forum/";s:11:"description";s:324:"Over the coming weeks i will be phasing out the forum.\nThe shortcomings and broken code in BBPress is getting on my nerves.\nSo, behold! Starting today AdRotate along with some small fixes will be the first plugin to point yousers to a new support platform.\nIf things work out it will replace the forum. This new system [...]";s:3:"wfw";a:1:{s:10:"commentrss";s:53:"http://meandmymac.net/921/phasing-out-the-forum/feed/";}s:5:"slash";a:1:{s:8:"comments";s:1:"0";}s:7:"summary";s:324:"Over the coming weeks i will be phasing out the forum.\nThe shortcomings and broken code in BBPress is getting on my nerves.\nSo, behold! Starting today AdRotate along with some small fixes will be the first plugin to point yousers to a new support platform.\nIf things work out it will replace the forum. This new system [...]";}i:5;a:11:{s:5:"title";s:14:"AdRotate 2.6.1";s:4:"link";s:41:"http://meandmymac.net/920/adrotate-2-6-1/";s:8:"comments";s:50:"http://meandmymac.net/920/adrotate-2-6-1/#comments";s:7:"pubdate";s:31:"Sat, 15 May 2010 15:58:23 +0000";s:2:"dc";a:1:{s:7:"creator";s:5:"Arnan";}s:8:"category";s:38:"Uncategorizedadrotatefixedpluginupdate";s:4:"guid";s:41:"http://meandmymac.net/920/adrotate-2-6-1/";s:11:"description";s:511:"A small update introducing the new support system i will be using on Meandmymac.net as well as some minor changes and bugfixes.\nMore information:\nhttp://meandmymac.net/plugins/adrotate/\nDownload:\nhttp://downloads.wordpress.org/plugin/adrotate.2.6.zip\nChangelog:\n[update] Support links for meandmymac.net\n[fix] Renewal message no longer states renewal of 1 year.\n[change] Dashboard Widget, stats are now more relevant and accurate\n[fix] Group deletion including all ads gives the right message\n[change] New [...]";s:3:"wfw";a:1:{s:10:"commentrss";s:46:"http://meandmymac.net/920/adrotate-2-6-1/feed/";}s:5:"slash";a:1:{s:8:"comments";s:1:"0";}s:7:"summary";s:511:"A small update introducing the new support system i will be using on Meandmymac.net as well as some minor changes and bugfixes.\nMore information:\nhttp://meandmymac.net/plugins/adrotate/\nDownload:\nhttp://downloads.wordpress.org/plugin/adrotate.2.6.zip\nChangelog:\n[update] Support links for meandmymac.net\n[fix] Renewal message no longer states renewal of 1 year.\n[change] Dashboard Widget, stats are now more relevant and accurate\n[fix] Group deletion including all ads gives the right message\n[change] New [...]";}i:6;a:11:{s:5:"title";s:31:"Pretty Mining Op in Eve Online!";s:4:"link";s:57:"http://meandmymac.net/919/pretty-mining-op-in-eve-online/";s:8:"comments";s:66:"http://meandmymac.net/919/pretty-mining-op-in-eve-online/#comments";s:7:"pubdate";s:31:"Tue, 04 May 2010 18:17:14 +0000";s:2:"dc";a:1:{s:7:"creator";s:5:"Arnan";}s:8:"category";s:25:"Uncategorizedcoolevegames";s:4:"guid";s:57:"http://meandmymac.net/919/pretty-mining-op-in-eve-online/";s:11:"description";s:323:"\nSomewhere in the middle is a Capital Industrial Ship, called &#8220;orca&#8221;. It&#8217;s large, has lots of storage space.\nAround it are me and some mates mining away at the asteroids scattered in this area. The yellow beams are mining lasers destroying the asteroid belt! HARR!!\nWe&#8217;re gonna make millions today!\n";s:3:"wfw";a:1:{s:10:"commentrss";s:62:"http://meandmymac.net/919/pretty-mining-op-in-eve-online/feed/";}s:5:"slash";a:1:{s:8:"comments";s:1:"0";}s:7:"summary";s:323:"\nSomewhere in the middle is a Capital Industrial Ship, called &#8220;orca&#8221;. It&#8217;s large, has lots of storage space.\nAround it are me and some mates mining away at the asteroids scattered in this area. The yellow beams are mining lasers destroying the asteroid belt! HARR!!\nWe&#8217;re gonna make millions today!\n";}i:7;a:11:{s:5:"title";s:47:"Horrible Documentation == Source of Frustration";s:4:"link";s:71:"http://meandmymac.net/917/horrible-documentation-source-of-frustration/";s:8:"comments";s:80:"http://meandmymac.net/917/horrible-documentation-source-of-frustration/#comments";s:7:"pubdate";s:31:"Wed, 21 Apr 2010 21:12:40 +0000";s:2:"dc";a:1:{s:7:"creator";s:5:"Arnan";}s:8:"category";s:48:"Uncategorizedbrokenphppluginunmotivatedwordpress";s:4:"guid";s:71:"http://meandmymac.net/917/horrible-documentation-source-of-frustration/";s:11:"description";s:339:"Today i was working on some things for my AdRotate plugin. Then a sudden lack of documentation hit me. People on IRC who know nothing. And endless, not working, examples from a million websites made me get highly annoyed, frustrated and very unmotivated to do anything with Wordpress.\nAs so often with Wordpress the documentation was [...]";s:3:"wfw";a:1:{s:10:"commentrss";s:76:"http://meandmymac.net/917/horrible-documentation-source-of-frustration/feed/";}s:5:"slash";a:1:{s:8:"comments";s:2:"11";}s:7:"summary";s:339:"Today i was working on some things for my AdRotate plugin. Then a sudden lack of documentation hit me. People on IRC who know nothing. And endless, not working, examples from a million websites made me get highly annoyed, frustrated and very unmotivated to do anything with Wordpress.\nAs so often with Wordpress the documentation was [...]";}i:8;a:11:{s:5:"title";s:38:"A support ticket system ? Your advise?";s:4:"link";s:62:"http://meandmymac.net/916/a-support-ticket-system-your-advise/";s:8:"comments";s:71:"http://meandmymac.net/916/a-support-ticket-system-your-advise/#comments";s:7:"pubdate";s:31:"Wed, 14 Apr 2010 17:46:05 +0000";s:2:"dc";a:1:{s:7:"creator";s:5:"Arnan";}s:8:"category";s:38:"Uncategorizedhelpprojectsupporttickets";s:4:"guid";s:62:"http://meandmymac.net/916/a-support-ticket-system-your-advise/";s:11:"description";s:333:"For an upcoming project i&#8217;m gonna need some simple noob proof ticket/issuetracking system.\nI have discussed this matter with my webhost and they claim that on their system there is no option for trac. Which is a pity.\nAny system that runs of of a Linux/PHP/CGI server that has an easy interface and works solidly would do [...]";s:3:"wfw";a:1:{s:10:"commentrss";s:67:"http://meandmymac.net/916/a-support-ticket-system-your-advise/feed/";}s:5:"slash";a:1:{s:8:"comments";s:1:"2";}s:7:"summary";s:333:"For an upcoming project i&#8217;m gonna need some simple noob proof ticket/issuetracking system.\nI have discussed this matter with my webhost and they claim that on their system there is no option for trac. Which is a pity.\nAny system that runs of of a Linux/PHP/CGI server that has an easy interface and works solidly would do [...]";}i:9;a:11:{s:5:"title";s:24:"New thoughts on the iPad";s:4:"link";s:51:"http://meandmymac.net/915/new-thoughts-on-the-ipad/";s:8:"comments";s:60:"http://meandmymac.net/915/new-thoughts-on-the-ipad/#comments";s:7:"pubdate";s:31:"Sat, 10 Apr 2010 10:46:44 +0000";s:2:"dc";a:1:{s:7:"creator";s:5:"Arnan";}s:8:"category";s:30:"Uncategorizedappleipadproducts";s:4:"guid";s:51:"http://meandmymac.net/915/new-thoughts-on-the-ipad/";s:11:"description";s:322:"Now that it&#8217;s out for a bit. I still can&#8217;t get one here in the Netherlands&#8230; But hey, a lot more information is available.\nPositive reviews from friends and mates. And the upcoming iPhone OS 4. I now too am inflicted the iPad madness. \nI want one.\nI still think it&#8217;s a large iPod Touch, but it [...]";s:3:"wfw";a:1:{s:10:"commentrss";s:56:"http://meandmymac.net/915/new-thoughts-on-the-ipad/feed/";}s:5:"slash";a:1:{s:8:"comments";s:1:"2";}s:7:"summary";s:322:"Now that it&#8217;s out for a bit. I still can&#8217;t get one here in the Netherlands&#8230; But hey, a lot more information is available.\nPositive reviews from friends and mates. And the upcoming iPhone OS 4. I now too am inflicted the iPad madness. \nI want one.\nI still think it&#8217;s a large iPod Touch, but it [...]";}}s:7:"channel";a:8:{s:5:"title";s:13:"Me and my Mac";s:4:"link";s:21:"http://meandmymac.net";s:11:"description";s:33:"Not just another WordPress weblog";s:13:"lastbuilddate";s:31:"Tue, 01 Jun 2010 22:37:46 +0000";s:9:"generator";s:29:"http://wordpress.org/?v=2.9.2";s:8:"language";s:2:"en";s:2:"sy";a:2:{s:12:"updateperiod";s:6:"hourly";s:15:"updatefrequency";s:1:"1";}s:7:"tagline";s:33:"Not just another WordPress weblog";}s:9:"textinput";a:0:{}s:5:"image";a:0:{}s:9:"feed_type";s:3:"RSS";s:12:"feed_version";s:3:"2.0";s:5:"stack";a:0:{}s:9:"inchannel";b:0;s:6:"initem";b:0;s:9:"incontent";b:0;s:11:"intextinput";b:0;s:7:"inimage";b:0;s:13:"current_field";s:0:"";s:17:"current_namespa