(175, 1, '2010-01-13 23:25:17', '2010-01-14 04:25:17', 'KVRX 91.7 FM stands alone in the "Live Music Capital of the World" as the consummate source for indie and underrepresented music. The UT student-produced programming airs on the FM dial between 7 p.m. and 9 a.m. during the week and between 10 p.m. and 9 a.m. on weekends. KVRX streams live over the Internet 24/7 at KVRX.org.', 'Media - Radio - Left', '', 'publish', 'closed', 'closed', '', 'media-radio-left', '', '', '2010-06-11 09:08:42', '2010-06-11 14:08:42', '', 0, 'http://dustinyounse.com/?p=175', 0, 'post', '', 0),
