(178, 1, '2010-01-13 23:31:38', '2010-01-14 04:31:38', 'Texas Student Television (TSTV) is the nation''s only student-run, FCC-licensed television station. TSTV''s over-the-air signal, channel nine, reaches homes in central and east Austin 24 hours a day, seven days a week.\r\n\r\nTSTV programming also airs weeknights from 9 p.m. to 10 p.m. on Time Warner Cable channel 16, which provides service to 200,000 households. Dorm and broadcast viewers combined, 20,390 people watch TSTV.', 'Media - Television - Left', '', 'publish', 'closed', 'closed', '', 'media-television-left', '', '', '2010-06-11 09:10:02', '2010-06-11 14:10:02', '', 0, 'http://dustinyounse.com/?p=178', 0, 'post', '', 0),
