(200, 1, '2010-01-16 22:53:09', '2010-01-17 03:53:09', '<div>\n<div id="rates">\n<h1 style="text-align: center;">Contract Printing Rates</h1>\n(Effective August 20, 2008)\n\nMinimum pressrun of 1,000 copies\n<h2 style="text-align: center;">30# weight Standard Newsprint</h2>\n<table id="RatesT1" style="text-align: center;" summary="Rates for tabloid printing">\n<tbody>\n<tr>\n<th>Tabloid Pages</th>\n<th style="text-align: right;">First 1,000 Copies</th>\n<th>Additional 1,000 Copies</th>\n</tr>\n<tr>\n<td>8</td>\n<td>$214.00</td>\n<td>$36.00</td>\n</tr>\n<tr>\n<td>12</td>\n<td>276.00</td>\n<td>54.00</td>\n</tr>\n<tr>\n<td>16</td>\n<td>368.00</td>\n<td>72.00</td>\n</tr>\n<tr>\n<td>20</td>\n<td>460.00</td>\n<td>90.00</td>\n</tr>\n<tr>\n<td>24</td>\n<td>552.00</td>\n<td>108.00</td>\n</tr>\n<tr>\n<td>32</td>\n<td>736.00</td>\n<td>144.00</td>\n</tr>\n</tbody>\n</table>\n<table id="RatesT2" style="text-align: center;" summary="Rates for broadsheet printing">\n<tbody>\n<tr>\n<th>Broadsheet Pages*</th>\n<th>First 1,000 Copies</th>\n<th>Additional 1,000 Copies</th>\n</tr>\n<tr>\n<td>4</td>\n<td>$214.00</td>\n<td>$36.00</td>\n</tr>\n<tr>\n<td>6</td>\n<td>276.00</td>\n<td>54.00</td>\n</tr>\n<tr>\n<td>8</td>\n<td>368.00</td>\n<td>72.00</td>\n</tr>\n<tr>\n<td>10</td>\n<td>460.00</td>\n<td>90.00</td>\n</tr>\n<tr>\n<td>12</td>\n<td>552.00</td>\n<td>108.00</td>\n</tr>\n<tr>\n<td>16</td>\n<td>736.00</td>\n<td>144.00</td>\n</tr>\n<tr>\n<td>20</td>\n<td>920.00</td>\n<td>180.00</td>\n</tr>\n<tr>\n<td>24</td>\n<td>1104.00</td>\n<td>216.00</td>\n</tr>\n</tbody>\n</table>\n<p style="text-align: center;">*pages 4-10 are One Section, 12-24 Two Sections</p>\nAll materials should be received by 3pm two business days prior to print date. Tabloid Image area is 10" wide x 11.6" tall; broad sheet images area is 11.6" wide 21" tall\n\n10% discount* off above pricing on jobs submitted with pdf files and by deadline.\n\n*applies to first 1000 copies only\n<h2 style="text-align: center;">Color Charges</h2>\nAdd color to front &amp; back of each broadsheet sections or front, back &amp; middle spread of a tabloid paper\n\n$60 spot color\n\n$180 process color\n\nOn broadsheet newspapers, if you want a black &amp; white double truck in the middle of a section, there will be an extra $50.00 charge.\n<h2 style="text-align: center;">Delivery Charges</h2>\n<ul>\n	<li>In-town same-day delivery $30.00*</li>\n	<li>Out-of-town next-day delivery CALL</li>\n</ul>\n*$40.00 if over 10 miles rom UT\n\n</div>\n</div>', 'Rates - Print', '', 'inherit', 'closed', 'closed', '', '197-autosave', '', '', '2010-01-16 22:53:09', '2010-01-17 03:53:09', '', 197, 'http://dustinyounse.com/?p=200', 0, 'revision', '', 0),
