(309, 1, '2010-01-14 19:06:19', '2010-01-15 00:06:19', 'DT Weekend is the UT community’s entertainment resource—bringing news, events, and specials to the fun-seeking college crowd. This weekly tabloid publishes every Thursday while school is in  session and features music listings, movie listings, theater/arts listings, food listings and Happy Hour listings.', 'Media - Print - DT Weekend - Left', '', 'publish', 'closed', 'closed', '', 'media-print-dt-weekend-left', '', '', '2010-06-11 22:05:53', '2010-06-12 03:05:53', '', 0, 'http://dustinyounse.com/?p=309', 0, 'post', '', 0),
