(361, 1, '2010-01-14 20:49:32', '2010-01-15 01:49:32', 'Texas Student Television (TSTV) is the nation''s only student-run, FCC-licensed television station. TSTV''s over-the-air signal, channel nine, reaches homes in central and east Austin 24 hours a day, seven days a week.\n\nTSTV programming also airs weeknights from 9 p.m. to 10 p.m. on Time Warner Cable channel 16, which provides service to 200,000 households. Dorm and broadcast viewers combined, 20,390 people watch TSTV.', 'Media - Television', '', 'inherit', 'closed', 'closed', '', '178-autosave', '', '', '2010-01-14 20:49:32', '2010-01-15 01:49:32', '', 178, 'http://dustinyounse.com/?p=361', 0, 'revision', '', 0),
