(389, 1, '2010-01-14 19:23:38', '2010-01-15 00:23:38', 'Commemorate some of the most important, remember some of the most painful and celebrate some of the most exciting moments of the past academic year. The issue is a keepsake, and the entertainment, sports and news stories will remind students and their parents of an important year for the University, state and nation for years to come.', 'Year In Review', '', 'inherit', 'closed', 'closed', '', '336-revision-2', '', '', '2010-01-14 19:23:38', '2010-01-15 00:23:38', '', 336, 'http://dustinyounse.com/?p=389', 0, 'revision', '', 0),
(390, 1, '2010-01-14 19:22:49', '2010-01-15 00:22:49', 'The UT Community votes for its UTmost favorites in an on-line survey about all things UT! The results, including UTmost happy hour specials, independent coffee houses, live music venues, UT athletes, UT professors, and more, are published in this special edition.', 'UT Most', '', 'inherit', 'closed', 'closed', '', '334-revision-2', '', '', '2010-01-14 19:22:49', '2010-01-15 00:22:49', '', 334, 'http://dustinyounse.com/?p=390', 0, 'revision', '', 0),
(391, 1, '2010-01-14 19:21:23', '2010-01-15 00:21:23', 'The Welcome Back Edition publishes twice and will be on stands the Monday and Tuesday before classes start. Catch the students as they gear up to begin class. It includes the Longhorn Life publication.', 'Welcome Back Edition', '', 'inherit', 'closed', 'closed', '', '332-revision-2', '', '', '2010-01-14 19:21:23', '2010-01-15 00:21:23', '', 332, 'http://dustinyounse.com/?p=391', 0, 'revision', '', 0),
(392, 1, '2010-01-14 19:20:46', '2010-01-15 00:20:46', 'Reach Austin’s most active crowd when the weather is right! UT students are actively living it up in Austin’s restaurants, bars and live music venues, actively buying the latest and greatest trends, actively searching for new and better ways to have fun and actively looking for next semester’s living quarters.', 'Summer In Austin', '', 'inherit', 'closed', 'closed', '', '330-revision-2', '', '', '2010-01-14 19:20:46', '2010-01-15 00:20:46', '', 330, 'http://dustinyounse.com/?p=392', 0, 'revision', '', 0),
(393, 1, '2010-01-14 19:19:07', '2010-01-15 00:19:07', 'The Texas Travesty, the largest college humor publication in the nation, outrages a cult following of over 90,000 readers. The loud, lewd and utterly inappropriate Texas Travesty is published once in the summer and three times each spring and fall semester in print and on the Web at <a href="http://www.texastravesty.com" target="_blank">www.TexasTravesty.com</a>.', 'Travesty', '', 'inherit', 'closed', 'closed', '', '328-revision-2', '', '', '2010-01-14 19:19:07', '2010-01-15 00:19:07', '', 328, 'http://dustinyounse.com/?p=393', 0, 'revision', '', 0),
(394, 1, '2010-01-14 19:14:40', '2010-01-15 00:14:40', 'People everywhere pay attention when the subject of SEX surfaces. Reach the UT community with this scintillating special of The Daily Texan just in time for Valentine’s Day. The University landscape is an advertiser’s dreamland for pitching products and services in time for the biggest date-night of the year.', 'Sex 101', '', 'inherit', 'closed', 'closed', '', '326-revision-2', '', '', '2010-01-14 19:14:40', '2010-01-15 00:14:40', '', 326, 'http://dustinyounse.com/?p=394', 0, 'revision', '', 0),
(395, 1, '2010-01-14 19:14:01', '2010-01-15 00:14:01', '"Our Campus”, a faculty and staff publication of Texas Student Media, is delivered directly to UT’s departments. It serves as a source of campus news for faculty and staff and a vehicle for highlighting their personal and professional accomplishments.', 'Our Campus', '', 'inherit', 'closed', 'closed', '', '323-revision-3', '', '', '2010-01-14 19:14:01', '2010-01-15 00:14:01', '', 323, 'http://dustinyounse.com/?p=395', 0, 'revision', '', 0),
(396, 1, '2010-01-14 19:12:59', '2010-01-15 00:12:59', 'This special edition showcases the high-profile annual spring fashion show hosted by UT’s Division of Textiles and Apparel. The show draws a crowd of 5,000 spectators, making it the largest university-sponsored fashion show in the nation. Support Austin’s future designers and reach UT and Austin’s most active shoppers.', 'Orange Runway', '', 'inherit', 'closed', 'closed', '', '321-revision-2', '', '', '2010-01-14 19:12:59', '2010-01-15 00:12:59', '', 321, 'http://dustinyounse.com/?p=396', 0, 'revision', '', 0),
(397, 1, '2010-01-14 19:11:09', '2010-01-15 00:11:09', 'Reach 4,400 Greeks, in 50 different chapters, representing 11% of UT’s undergraduate population with this special edition. It is inserted in 19,000 copies of The Daily Texan and distributed to the Greek houses on and off campus. Target one of the most socially active, well-funded segments of UT’s student community  with this unique edition.', 'Greek Life', '', 'inherit', 'closed', 'closed', '', '319-revision-2', '', '', '2010-01-14 19:11:09', '2010-01-15 00:11:09', '', 319, 'http://dustinyounse.com/?p=397', 0, 'revision', '', 0),
(398, 1, '2010-01-14 19:10:02', '2010-01-15 00:10:02', 'This series of pullout living guides provides the UT community convenient ways to explore the Austin market and gives advertisers a full-force marketing  platform to reach their target market. Special Editorial Features include: Health, Technology, Current Events, Culture, Housing and more.', 'Longhorn Life', '', 'inherit', 'closed', 'closed', '', '317-revision-2', '', '', '2010-01-14 19:10:02', '2010-01-15 00:10:02', '', 317, 'http://dustinyounse.com/?p=398', 0, 'revision', '', 0),
(399, 1, '2010-01-14 19:09:23', '2010-01-15 00:09:23', 'The Final Exam Schedule is the students’ tool for navigating final’s week and its aftermath. This popular edition offers a diversion from the stress of test-taking with crossword puzzles throughout. It is the only printed final exam schedule issued by UT.', 'Final Exam Schedule', '', 'inherit', 'closed', 'closed', '', '315-revision-2', '', '', '2010-01-14 19:09:23', '2010-01-15 00:09:23', '', 315, 'http://dustinyounse.com/?p=399', 0, 'revision', '', 0),
(400, 1, '2010-01-15 02:26:12', '2010-01-15 07:26:12', 'The Final Exam Schedule is the students’ tool for navigating final’s week and its aftermath. This popular edition offers a diversion from the stress of test-taking with crossword puzzles throughout. It is the only printed final exam schedule issued by UT.', 'Media - Print - Final Exam Schedule', '', 'inherit', 'closed', 'closed', '', '315-revision-3', '', '', '2010-01-15 02:26:12', '2010-01-15 07:26:12', '', 315, 'http://dustinyounse.com/?p=400', 0, 'revision', '', 0),
(401, 1, '2010-01-14 19:28:45', '2010-01-15 00:28:45', 'Reach a highly targeted, untapped audience with this unparalleled product. These special editions are mailed directly to the homes of incoming transfer students, freshmen and their families just before they attend orientation and again before they begin class in the Fall. Contact UT’s inbound students before they step foot on campus with this unique product.', 'Freshman Orientation', '', 'inherit', 'closed', 'closed', '', '313-revision-3', '', '', '2010-01-14 19:28:45', '2010-01-15 00:28:45', '', 313, 'http://dustinyounse.com/?p=401', 0, 'revision', '', 0),
(402, 1, '2010-01-14 19:28:52', '2010-01-15 00:28:52', 'Exam Week Extra is the hearty last issue of the semester and remains on the newsstands for a whopping 27 days! It includes the Longhorn Life housing guide.', 'Exam Week Extra', '', 'inherit', 'closed', 'closed', '', '311-revision-5', '', '', '2010-01-14 19:28:52', '2010-01-15 00:28:52', '', 311, 'http://dustinyounse.com/?p=402', 0, 'revision', '', 0),
(403, 1, '2010-01-14 20:47:01', '2010-01-15 01:47:01', 'DTWeekend is the UT community’s entertainment resource—bringing news, events, and specials to the fun-seeking college crowd. This weekly tabloid publishes every Thursday while school is in  session and features music listings, movie listings, theater/arts listings, food listings and Happy Hour listings.', 'DT Weekend', '', 'inherit', 'closed', 'closed', '', '309-revision-6', '', '', '2010-01-14 20:47:01', '2010-01-15 01:47:01', '', 309, 'http://dustinyounse.com/?p=403', 0, 'revision', '', 0),
(404, 1, '2010-01-14 19:28:59', '2010-01-15 00:28:59', 'The Texan’s Double Coverage football publication presents award-winning sports coverage before every home game and at the infamous OU-Texas rival game  in Dallas. It is distributed in The Daily Texan the Friday before home games, handed out at the Kickoff Countdown tailgate function and distributed at the Texas Exes  Alumni Center.', 'Double Coverage', '', 'inherit', 'closed', 'closed', '', '307-revision-6', '', '', '2010-01-14 19:28:59', '2010-01-15 00:28:59', '', 307, 'http://dustinyounse.com/?p=404', 0, 'revision', '', 0),
(405, 1, '2010-01-14 19:29:16', '2010-01-15 00:29:16', 'The Daily Texan, publishing since 1900, is the largest college publication in the nation. It has won more national, regional and state awards than any other college newspaper. The Daily Texan counts among its alumni winners of 10 Pulitzer Prizes.', 'Daily Texan', '', 'inherit', 'closed', 'closed', '', '305-revision-3', '', '', '2010-01-14 19:29:16', '2010-01-15 00:29:16', '', 305, 'http://dustinyounse.com/?p=405', 0, 'revision', '', 0),
(406, 1, '2010-01-14 19:29:23', '2010-01-15 00:29:23', 'The Cactus is the only pictorial record of the year at the University of Texas at Austin. As a book written and produced entirely by students it offers  experience in writing, editing, photography, management and marketing. The Cactus, now entering its 112th year, has been known for excellence and consistently wins honors in state, regional and national contests.', 'Cactus', '', 'inherit', 'closed', 'closed', '', '302-revision-3', '', '', '2010-01-14 19:29:23', '2010-01-15 00:29:23', '', 302, 'http://dustinyounse.com/?p=406', 0, 'revision', '', 0),
(407, 1, '2010-01-14 19:29:31', '2010-01-15 00:29:31', 'This special Longhorn holiday gift resource focuses on holiday gift options for UT-Austin students, faculty &amp; staff. Not only do you target students composing wish lists, but also copies will be mailed to UT students’ parents who reside in Austin.', 'Bevo''s Wishlist', '', 'inherit', 'closed', 'closed', '', '298-revision-4', '', '', '2010-01-14 19:29:31', '2010-01-15 00:29:31', '', 298, 'http://dustinyounse.com/?p=407', 0, 'revision', '', 0),
