(452, 1, '2010-01-15 02:27:44', '2010-01-15 07:27:44', 'This special Longhorn holiday gift resource focuses on holiday gift options for UT-Austin students, faculty &amp; staff. Not only do you target students composing wish lists, but also copies will be mailed to UT students’ parents who reside in Austin.', 'Media - Print - Bevo''s Wishlist', '', 'inherit', 'closed', 'closed', '', '298-revision-5', '', '', '2010-01-15 02:27:44', '2010-01-15 07:27:44', '', 298, 'http://dustinyounse.com/?p=452', 0, 'revision', '', 0),
(453, 1, '2010-01-15 02:27:28', '2010-01-15 07:27:28', 'The Cactus is the only pictorial record of the year at the University of Texas at Austin. As a book written and produced entirely by students it offers  experience in writing, editing, photography, management and marketing. The Cactus, now entering its 112th year, has been known for excellence and consistently wins honors in state, regional and national contests.', 'Media - Print - Cactus', '', 'inherit', 'closed', 'closed', '', '302-revision-4', '', '', '2010-01-15 02:27:28', '2010-01-15 07:27:28', '', 302, 'http://dustinyounse.com/?p=453', 0, 'revision', '', 0),
(454, 1, '2010-01-15 02:27:18', '2010-01-15 07:27:18', 'The Daily Texan, publishing since 1900, is the largest college publication in the nation. It has won more national, regional and state awards than any other college newspaper. The Daily Texan counts among its alumni winners of 10 Pulitzer Prizes.', 'Media - Print - Daily Texan', '', 'inherit', 'closed', 'closed', '', '305-revision-4', '', '', '2010-01-15 02:27:18', '2010-01-15 07:27:18', '', 305, 'http://dustinyounse.com/?p=454', 0, 'revision', '', 0),
(455, 1, '2010-01-15 02:27:07', '2010-01-15 07:27:07', 'The Texan’s Double Coverage football publication presents award-winning sports coverage before every home game and at the infamous OU-Texas rival game  in Dallas. It is distributed in The Daily Texan the Friday before home games, handed out at the Kickoff Countdown tailgate function and distributed at the Texas Exes  Alumni Center.', 'Media - Print - Double Coverage', '', 'inherit', 'closed', 'closed', '', '307-revision-7', '', '', '2010-01-15 02:27:07', '2010-01-15 07:27:07', '', 307, 'http://dustinyounse.com/?p=455', 0, 'revision', '', 0),
(456, 1, '2010-01-15 02:26:56', '2010-01-15 07:26:56', 'DTWeekend is the UT community’s entertainment resource—bringing news, events, and specials to the fun-seeking college crowd. This weekly tabloid publishes every Thursday while school is in  session and features music listings, movie listings, theater/arts listings, food listings and Happy Hour listings.', 'Media - Print - DT Weekend', '', 'inherit', 'closed', 'closed', '', '309-revision-7', '', '', '2010-01-15 02:26:56', '2010-01-15 07:26:56', '', 309, 'http://dustinyounse.com/?p=456', 0, 'revision', '', 0),
(457, 1, '2010-01-15 02:26:41', '2010-01-15 07:26:41', 'Exam Week Extra is the hearty last issue of the semester and remains on the newsstands for a whopping 27 days! It includes the Longhorn Life housing guide.', 'Media - Print - Exam Week Extra', '', 'inherit', 'closed', 'closed', '', '311-revision-6', '', '', '2010-01-15 02:26:41', '2010-01-15 07:26:41', '', 311, 'http://dustinyounse.com/?p=457', 0, 'revision', '', 0),
(458, 1, '2010-01-15 02:26:20', '2010-01-15 07:26:20', 'The Final Exam Schedule is the students’ tool for navigating final’s week and its aftermath. This popular edition offers a diversion from the stress of test-taking with crossword puzzles throughout. It is the only printed final exam schedule issued by UT.', 'Media - Print - Final Exam Schedule', '', 'inherit', 'closed', 'closed', '', '315-revision-4', '', '', '2010-01-15 02:26:20', '2010-01-15 07:26:20', '', 315, 'http://dustinyounse.com/?p=458', 0, 'revision', '', 0),
(459, 1, '2010-01-15 02:26:31', '2010-01-15 07:26:31', 'Reach a highly targeted, untapped audience with this unparalleled product. These special editions are mailed directly to the homes of incoming transfer students, freshmen and their families just before they attend orientation and again before they begin class in the Fall. Contact UT’s inbound students before they step foot on campus with this unique product.', 'Media - Print - Freshman Orientation', '', 'inherit', 'closed', 'closed', '', '313-revision-4', '', '', '2010-01-15 02:26:31', '2010-01-15 07:26:31', '', 313, 'http://dustinyounse.com/?p=459', 0, 'revision', '', 0),
(460, 1, '2010-01-15 02:25:48', '2010-01-15 07:25:48', 'Reach 4,400 Greeks, in 50 different chapters, representing 11% of UT’s undergraduate population with this special edition. It is inserted in 19,000 copies of The Daily Texan and distributed to the Greek houses on and off campus. Target one of the most socially active, well-funded segments of UT’s student community  with this unique edition.', 'Media - Print - Greek Life', '', 'inherit', 'closed', 'closed', '', '319-revision-3', '', '', '2010-01-15 02:25:48', '2010-01-15 07:25:48', '', 319, 'http://dustinyounse.com/?p=460', 0, 'revision', '', 0),
(461, 1, '2010-01-16 18:57:23', '2010-01-16 23:57:23', 'This series of pullout living guides provides the UT community convenient ways to explore the Austin market and gives advertisers a full-force marketing  platform to reach their target market. Special Editorial Features include: Health, Technology, Current Events, Culture, Housing and more.\r\n\r\nTest\r\n\r\nTest\r\n\r\nTest', 'Media - Print - Longhorn Life', '', 'inherit', 'closed', 'closed', '', '317-revision-4', '', '', '2010-01-16 18:57:23', '2010-01-16 23:57:23', '', 317, 'http://dustinyounse.com/?p=461', 0, 'revision', '', 0),
(462, 1, '2010-01-15 02:23:41', '2010-01-15 07:23:41', 'The New Students’ Edition is mailed directly to the homes of the incoming transfer students, freshmen, and their families just before they leave home and come to UT. It includes the Longhorn Life publication.', 'Media - Print - New Students'' Edition', '', 'inherit', 'closed', 'closed', '', '354-revision-3', '', '', '2010-01-15 02:23:41', '2010-01-15 07:23:41', '', 354, 'http://dustinyounse.com/?p=462', 0, 'revision', '', 0),
(463, 1, '2010-01-15 02:25:38', '2010-01-15 07:25:38', 'This special edition showcases the high-profile annual spring fashion show hosted by UT’s Division of Textiles and Apparel. The show draws a crowd of 5,000 spectators, making it the largest university-sponsored fashion show in the nation. Support Austin’s future designers and reach UT and Austin’s most active shoppers.', 'Media - Print - Orange Runway', '', 'inherit', 'closed', 'closed', '', '321-revision-3', '', '', '2010-01-15 02:25:38', '2010-01-15 07:25:38', '', 321, 'http://dustinyounse.com/?p=463', 0, 'revision', '', 0),
(464, 1, '2010-01-15 02:25:25', '2010-01-15 07:25:25', '"Our Campus”, a faculty and staff publication of Texas Student Media, is delivered directly to UT’s departments. It serves as a source of campus news for faculty and staff and a vehicle for highlighting their personal and professional accomplishments.', 'Media - Print - Our Campus', '', 'inherit', 'closed', 'closed', '', '323-revision-4', '', '', '2010-01-15 02:25:25', '2010-01-15 07:25:25', '', 323, 'http://dustinyounse.com/?p=464', 0, 'revision', '', 0),
(465, 1, '2010-01-15 02:25:14', '2010-01-15 07:25:14', 'People everywhere pay attention when the subject of SEX surfaces. Reach the UT community with this scintillating special of The Daily Texan just in time for Valentine’s Day. The University landscape is an advertiser’s dreamland for pitching products and services in time for the biggest date-night of the year.', 'Media - Print - Sex 101', '', 'inherit', 'closed', 'closed', '', '326-revision-3', '', '', '2010-01-15 02:25:14', '2010-01-15 07:25:14', '', 326, 'http://dustinyounse.com/?p=465', 0, 'revision', '', 0),
(466, 1, '2010-01-15 02:25:02', '2010-01-15 07:25:02', 'The Texas Travesty, the largest college humor publication in the nation, outrages a cult following of over 90,000 readers. The loud, lewd and utterly inappropriate Texas Travesty is published once in the summer and three times each spring and fall semester in print and on the Web at <a href="http://www.texastravesty.com" target="_blank">www.TexasTravesty.com</a>.', 'Media - Print - Travesty', '', 'inherit', 'closed', 'closed', '', '328-revision-3', '', '', '2010-01-15 02:25:02', '2010-01-15 07:25:02', '', 328, 'http://dustinyounse.com/?p=466', 0, 'revision', '', 0),
(467, 1, '2010-01-15 15:35:06', '2010-01-15 20:35:06', 'The UT Community votes for its UTmost favorites in an on-line survey about all things UT! The results, including UTmost happy hour specials, independent coffee houses, live music venues, UT athletes, UT professors, and more, are published in this special edition.\r\n\r\nThe UT Community votes for its UTmost favorites in an on-line survey about all things UT! The results, including UTmost happy hour specials, independent coffee houses, live music venues, UT athletes, UT professors, and more, are published in this special edition.', 'Media - Print - UT Most', '', 'inherit', 'closed', 'closed', '', '334-revision-4', '', '', '2010-01-15 15:35:06', '2010-01-15 20:35:06', '', 334, 'http://dustinyounse.com/?p=467', 0, 'revision', '', 0),
(469, 1, '2010-01-15 02:24:18', '2010-01-15 07:24:18', 'Commemorate some of the most important, remember some of the most painful and celebrate some of the most exciting moments of the past academic year. The issue is a keepsake, and the entertainment, sports and news stories will remind students and their parents of an important year for the University, state and nation for years to come.', 'Media - Print - Year In Review', '', 'inherit', 'closed', 'closed', '', '336-revision-3', '', '', '2010-01-15 02:24:18', '2010-01-15 07:24:18', '', 336, 'http://dustinyounse.com/?p=469', 0, 'revision', '', 0),
