(486, 1, '2010-01-16 22:45:47', '2010-01-17 03:45:47', '<div>\r\n<div id="rates">\r\n<h1 style="text-align: center;">Contract Printing Rates</h1>\r\n(Effective August 20, 2008)\r\n\r\nMinimum pressrun of 1,000 copies\r\n<h2>30# weight Standard Newsprint</h2>\r\n<table id="RatesT1" summary="Rates for tabloid printing">\r\n<tbody>\r\n<tr>\r\n<th>Tabloid Pages</th>\r\n<th>First 1,000 Copies</th>\r\n<th>Additional 1,000 Copies</th>\r\n</tr>\r\n<tr>\r\n<td>8</td>\r\n<td>$214.00</td>\r\n<td>$36.00</td>\r\n</tr>\r\n<tr>\r\n<td>12</td>\r\n<td>276.00</td>\r\n<td>54.00</td>\r\n</tr>\r\n<tr>\r\n<td>16</td>\r\n<td>368.00</td>\r\n<td>72.00</td>\r\n</tr>\r\n<tr>\r\n<td>20</td>\r\n<td>460.00</td>\r\n<td>90.00</td>\r\n</tr>\r\n<tr>\r\n<td>24</td>\r\n<td>552.00</td>\r\n<td>108.00</td>\r\n</tr>\r\n<tr>\r\n<td>32</td>\r\n<td>736.00</td>\r\n<td>144.00</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table id="RatesT2" summary="Rates for broadsheet printing">\r\n<tbody>\r\n<tr>\r\n<th>Broadsheet Pages*</th>\r\n<th>First 1,000 Copies</th>\r\n<th>Additional 1,000 Copies</th>\r\n</tr>\r\n<tr>\r\n<td>4</td>\r\n<td>$214.00</td>\r\n<td>$36.00</td>\r\n</tr>\r\n<tr>\r\n<td>6</td>\r\n<td>276.00</td>\r\n<td>54.00</td>\r\n</tr>\r\n<tr>\r\n<td>8</td>\r\n<td>368.00</td>\r\n<td>72.00</td>\r\n</tr>\r\n<tr>\r\n<td>10</td>\r\n<td>460.00</td>\r\n<td>90.00</td>\r\n</tr>\r\n<tr>\r\n<td>12</td>\r\n<td>552.00</td>\r\n<td>108.00</td>\r\n</tr>\r\n<tr>\r\n<td>16</td>\r\n<td>736.00</td>\r\n<td>144.00</td>\r\n</tr>\r\n<tr>\r\n<td>20</td>\r\n<td>920.00</td>\r\n<td>180.00</td>\r\n</tr>\r\n<tr>\r\n<td>24</td>\r\n<td>1104.00</td>\r\n<td>216.00</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n*pages 4-10 are One Section, 12-24 Two Sections\r\n\r\nAll materials should be received by 3pm two business days prior to print date. Tabloid Image area is 10" wide x 11.6" tall; broad sheet images area is 11.6" wide 21" tall\r\n\r\n10% discount* off above pricing on jobs submitted with pdf files and by deadline.\r\n\r\n*applies to first 1000 copies only\r\n<h2>Color Charges</h2>\r\nAdd color to front &amp; back of each broadsheet sections or front, back &amp; middle spread of a tabloid paper\r\n\r\n$60 spot color\r\n\r\n$180 process color\r\n\r\nOn broadsheet newspapers, if you want a black &amp; white double truck in the middle of a section, there will be an extra $50.00 charge.\r\n<h2>Delivery Charges</h2>\r\n<ul>\r\n	<li>In-town same-day delivery $30.00*</li>\r\n	<li>Out-of-town next-day delivery CALL</li>\r\n</ul>\r\n*$40.00 if over 10 miles rom UT\r\n\r\n</div>\r\n</div>', 'Rates - Print', '', 'inherit', 'closed', 'closed', '', '197-revision-6', '', '', '2010-01-16 22:45:47', '2010-01-17 03:45:47', '', 197, 'http://dustinyounse.com/?p=486', 0, 'revision', '', 0),
