(589, 1, '2010-01-13 23:40:41', '2010-01-14 04:40:41', 'We are the "Uncensored Voice" of the United States'' largest student body - the University of Texas at Austin. TSM is composed of several student-  produced print products: The Daily Texan newspaper, Our Campus, the humor magazine Texas Travesty and the Cactus yearbook.', 'Media - Online', '', 'inherit', 'closed', 'closed', '', '183-revision-2', '', '', '2010-01-13 23:40:41', '2010-01-14 04:40:41', '', 183, 'http://dustinyounse.com/uncategorized/183-revision-2/', 0, 'revision', '', 0),
(590, 1, '2010-01-16 20:42:58', '2010-01-17 01:42:58', '<h1>Summer In Austin</h1>\r\nReach Austin’s most active crowd when the weather is right! UT students are actively living it up in Austin’s restaurants, bars and live music venues, actively buying the latest and greatest trends, actively searching for new and better ways to have fun and actively looking for next semester’s living quarters.', 'Media - Print - Summer In Austin', '', 'inherit', 'closed', 'closed', '', '330-revision-6', '', '', '2010-01-16 20:42:58', '2010-01-17 01:42:58', '', 330, 'http://dustinyounse.com/uncategorized/330-revision-6/', 0, 'revision', '', 0),
