(595, 1, '2010-01-16 20:51:24', '2010-01-17 01:51:24', '<h1>The Daily Texan</h1>\r\nThe Daily Texan, publishing since 1900, is the largest college publication in the nation. It has won more national, regional and state awards than any other college newspaper. The Daily Texan counts among its alumni winners of 10 Pulitzer Prizes.', 'Media - Print - Daily Texan', '', 'inherit', 'closed', 'closed', '', '305-revision-5', '', '', '2010-01-16 20:51:24', '2010-01-17 01:51:24', '', 305, 'http://dustinyounse.com/uncategorized/305-revision-5/', 0, 'revision', '', 0),
(591, 1, '2010-01-16 21:00:10', '2010-01-17 02:00:10', '<h1>Welcome Back Edition</h1>\r\nThe Welcome Back Edition publishes twice and will be on stands the Monday and Tuesday before classes start. Catch the students as they gear up to begin class. It includes the Longhorn Life publication.', 'Media - Print - Welcome Back Edition', '', 'inherit', 'closed', 'closed', '', '332-revision-4', '', '', '2010-01-16 21:00:10', '2010-01-17 02:00:10', '', 332, 'http://dustinyounse.com/uncategorized/332-revision-4/', 0, 'revision', '', 0),
