(597, 1, '2010-01-16 20:57:49', '2010-01-17 01:57:49', '<h1>Our Campus</h1>\r\n"Our Campus”, a faculty and staff publication of Texas Student Media, is delivered directly to UT’s departments. It serves as a source of campus news for faculty and staff and a vehicle for highlighting their personal and professional accomplishments.', 'Media - Print - Our Campus', '', 'inherit', 'closed', 'closed', '', '323-revision-5', '', '', '2010-01-16 20:57:49', '2010-01-17 01:57:49', '', 323, 'http://dustinyounse.com/uncategorized/323-revision-5/', 0, 'revision', '', 0),
(598, 1, '2010-02-05 23:28:47', '2010-02-06 04:28:47', '<h1>The Daily Texan</h1>\r\nThe Daily Texan, publishing since 1900, is the largest college publication in the nation. It has won more national, regional and state awards than any other college newspaper. The Daily Texan counts among its alumni winners of 10 Pulitzer Prizes.\r\n\r\n<object style="width:420px;height:375px" ><param name="movie" value="http://static.issuu.com/webembed/viewers/style1/v1/IssuuViewer.swf?mode=embed&amp;layout=http%3A%2F%2Fskin.issuu.com%2Fv%2Flight%2Flayout.xml&amp;showFlipBtn=true&amp;documentId=100202083612-45904fb97e104c7f81aa0f99a7d47294&amp;docName=02-02-10&amp;username=thedailytexan&amp;loadingInfoText=The%20Daily%20Texan%2002%2F02%2F10&amp;et=1265430457026&amp;er=79" /><param name="allowfullscreen" value="true"/><param name="menu" value="false"/><embed src="http://static.issuu.com/webembed/viewers/style1/v1/IssuuViewer.swf" type="application/x-shockwave-flash" allowfullscreen="true" menu="false" style="width:420px;height:375px" flashvars="mode=embed&amp;layout=http%3A%2F%2Fskin.issuu.com%2Fv%2Flight%2Flayout.xml&amp;showFlipBtn=true&amp;documentId=100202083612-45904fb97e104c7f81aa0f99a7d47294&amp;docName=02-02-10&amp;username=thedailytexan&amp;loadingInfoText=The%20Daily%20Texan%2002%2F02%2F10&amp;et=1265430457026&amp;er=79" /></object>', 'Media - Print - Daily Texan', '', 'inherit', 'closed', 'closed', '', '305-revision-6', '', '', '2010-02-05 23:28:47', '2010-02-06 04:28:47', '', 305, 'http://dustinyounse.com/uncategorized/305-revision-6/', 0, 'revision', '', 0),
