(637, 1, '2010-02-05 23:34:03', '2010-02-06 04:34:03', '<h1>Our Campus</h1>\r\n"Our Campus”, a faculty and staff publication of Texas Student Media, is delivered directly to UT’s departments. It serves as a source of campus news for faculty and staff and a vehicle for highlighting their personal and professional accomplishments.\r\n\r\n<object style="width:420px;height:253px" ><param name="movie" value="http://static.issuu.com/webembed/viewers/style1/v1/IssuuViewer.swf?mode=embed&amp;layout=http%3A%2F%2Fskin.issuu.com%2Fv%2Flight%2Flayout.xml&amp;showFlipBtn=true&amp;documentId=091130170841-5c8359a4b1d94779b827712554240f3a&amp;docName=200911&amp;username=tsmadmin&amp;loadingInfoText=200911&amp;et=1265430800030&amp;er=68" /><param name="allowfullscreen" value="true"/><param name="menu" value="false"/><embed src="http://static.issuu.com/webembed/viewers/style1/v1/IssuuViewer.swf" type="application/x-shockwave-flash" allowfullscreen="true" menu="false" style="width:420px;height:253px" flashvars="mode=embed&amp;layout=http%3A%2F%2Fskin.issuu.com%2Fv%2Flight%2Flayout.xml&amp;showFlipBtn=true&amp;documentId=091130170841-5c8359a4b1d94779b827712554240f3a&amp;docName=200911&amp;username=tsmadmin&amp;loadingInfoText=200911&amp;et=1265430800030&amp;er=68" /></object>', 'Media - Print - Our Campus', '', 'inherit', 'closed', 'closed', '', '323-revision-6', '', '', '2010-02-05 23:34:03', '2010-02-06 04:34:03', '', 323, 'http://dustinyounse.com/?p=637', 0, 'revision', '', 0),
