(652, 1, '2010-01-17 00:42:39', '2010-01-17 05:42:39', '<h1>Texas Student Television</h1>\r\nTexas Student Television is the only student-run, student-produced, FCC-licensed college television station in the country. Students can learn camerawork, directing, producing, writing, and much more. Working with a broadcast adviser, the student staff makes all decisions about programming, use of equipment, marketing, outside production projects and the direction of the station.\r\n<a href="http://www.texasstudenttv.com/" target="_blank">http://www.texasstudenttv.com/</a>', 'Media - Online - Texas Student Television', '', 'inherit', 'closed', 'closed', '', '373-revision-4', '', '', '2010-01-17 00:42:39', '2010-01-17 05:42:39', '', 373, 'http://dustinyounse.com/?p=652', 0, 'revision', '', 0),
(653, 1, '2010-02-09 02:25:36', '2010-02-09 07:25:36', '<h1>Texas Student Television</h1>\r\nTexas Student Television is the only student-run, student-produced, FCC-licensed college television station in the country. Students can learn camerawork, directing, producing, writing, and much more. Working with a broadcast adviser, the student staff makes all decisions about programming, use of equipment, marketing, outside production projects and the direction of the station.\r\n<a href="http://www.texasstudenttv.com/" target="_blank">http://www.texasstudenttv.com/</a>', 'Media - Online - Texas Student Television', '', 'inherit', 'closed', 'closed', '', '373-revision-5', '', '', '2010-02-09 02:25:36', '2010-02-09 07:25:36', '', 373, 'http://dustinyounse.com/?p=653', 0, 'revision', '', 0),
(654, 1, '2010-02-05 23:36:02', '2010-02-06 04:36:02', '<h1>The Daily Texan</h1>\r\nThe Daily Texan, publishing since 1900, is the largest college publication in the nation. It has won more national, regional and state awards than any other college newspaper. The Daily Texan counts among its alumni winners of 10 Pulitzer Prizes.\r\n\r\n<object style="width:420px;height:375px" ><param name="movie" value="http://static.issuu.com/webembed/viewers/style1/v1/IssuuViewer.swf?mode=embed&amp;layout=http%3A%2F%2Fskin.issuu.com%2Fv%2Flight%2Flayout.xml&amp;showFlipBtn=true&amp;documentId=100206013152-1601daf6a53b45358b55d578186045de&amp;docName=02-05-10&amp;username=thedailytexan&amp;loadingInfoText=The%20Daily%20Texan%2002%2F05%2F10&amp;et=1265430922221&amp;er=45" /><param name="allowfullscreen" value="true"/><param name="menu" value="false"/><embed src="http://static.issuu.com/webembed/viewers/style1/v1/IssuuViewer.swf" type="application/x-shockwave-flash" allowfullscreen="true" menu="false" style="width:420px;height:375px" flashvars="mode=embed&amp;layout=http%3A%2F%2Fskin.issuu.com%2Fv%2Flight%2Flayout.xml&amp;showFlipBtn=true&amp;documentId=100206013152-1601daf6a53b45358b55d578186045de&amp;docName=02-05-10&amp;username=thedailytexan&amp;loadingInfoText=The%20Daily%20Texan%2002%2F05%2F10&amp;et=1265430922221&amp;er=45" /></object>', 'Media - Print - Daily Texan', '', 'inherit', 'closed', 'closed', '', '305-revision-7', '', '', '2010-02-05 23:36:02', '2010-02-06 04:36:02', '', 305, 'http://dustinyounse.com/?p=654', 0, 'revision', '', 0),
