(917, 1, '2010-01-16 20:52:10', '2010-01-17 01:52:10', '<h1>Double Coverage</h1>\r\nThe Texan’s Double Coverage football publication presents award-winning sports coverage before every home game and at the infamous OU-Texas rival game  in Dallas. It is distributed in The Daily Texan the Friday before home games, handed out at the Kickoff Countdown tailgate function and distributed at the Texas Exes  Alumni Center.', 'Media - Print - Double Coverage', '', 'inherit', 'closed', 'closed', '', '307-revision-8', '', '', '2010-01-16 20:52:10', '2010-01-17 01:52:10', '', 307, 'http://dustinyounse.com/?p=917', 0, 'revision', '', 0),
