(1077, 2, '2010-06-11 08:47:07', '2010-06-11 13:47:07', '<h1>Freshman Orientation</h1>\r\nReach a highly targeted, untapped audience with this unparalleled product. These special editions are mailed directly to the homes of incoming transfer students, freshmen and their families just before they attend orientation and again before they begin class in the Fall. Contact UT’s inbound students before they step foot on campus with this unique product.', 'Media - Print - Freshman Orientation - Left', '', 'inherit', 'closed', 'closed', '', '313-revision-6', '', '', '2010-06-11 08:47:07', '2010-06-11 13:47:07', '', 313, 'http://dustinyounse.com/uncategorized/313-revision-6/', 0, 'revision', '', 0),
