(942, 1, '2010-01-16 20:55:30', '2010-01-17 01:55:30', '<h1>Greek Life</h1>\r\nReach 4,400 Greeks, in 50 different chapters, representing 11% of UT’s undergraduate population with this special edition. It is inserted in 19,000 copies of The Daily Texan and distributed to the Greek houses on and off campus. Target one of the most socially active, well-funded segments of UT’s student community  with this unique edition.', 'Media - Print - Greek Life', '', 'inherit', 'closed', 'closed', '', '319-revision-4', '', '', '2010-01-16 20:55:30', '2010-01-17 01:55:30', '', 319, 'http://dustinyounse.com/?p=942', 0, 'revision', '', 0),
(1090, 1, '2010-06-11 08:39:44', '2010-06-11 13:39:44', '<h1>DTWeekend</h1>\r\nDTWeekend is the UT community’s entertainment resource—bringing news, events, and specials to the fun-seeking college crowd. This weekly tabloid publishes every Thursday while school is in  session and features music listings, movie listings, theater/arts listings, food listings and Happy Hour listings.', 'Media - Print - DT Weekend - Left', '', 'inherit', 'closed', 'closed', '', '309-revision-9', '', '', '2010-06-11 08:39:44', '2010-06-11 13:39:44', '', 309, 'http://dustinyounse.com/uncategorized/309-revision-9/', 0, 'revision', '', 0),
