(1076, 2, '2010-06-11 08:44:34', '2010-06-11 13:44:34', '<h1>Final Exam Schedule</h1>\r\nThe Final Exam Schedule is the students’ tool for navigating final’s week and its aftermath. This popular edition offers a diversion from the stress of test-taking with crossword puzzles throughout. It is the only printed final exam schedule issued by UT.', 'Media - Print - Final Exam Schedule - Left', '', 'inherit', 'closed', 'closed', '', '315-revision-6', '', '', '2010-06-11 08:44:34', '2010-06-11 13:44:34', '', 315, 'http://dustinyounse.com/uncategorized/315-revision-6/', 0, 'revision', '', 0),
