(1079, 1, '2010-06-11 08:53:12', '2010-06-11 13:53:12', '<h1>New Students'' Edition</h1>\r\nThe New Students’ Edition is mailed directly to the homes of the incoming transfer students, freshmen, and their families just before they leave home and come to UT. It includes the Longhorn Life publication.', 'Media - Print - New Students'' Edition - Left', '', 'inherit', 'closed', 'closed', '', '354-revision-5', '', '', '2010-06-11 08:53:12', '2010-06-11 13:53:12', '', 354, 'http://dustinyounse.com/uncategorized/354-revision-5/', 0, 'revision', '', 0),
(1085, 1, '2010-06-11 09:00:58', '2010-06-11 14:00:58', '<h1>Travesty</h1>\r\nThe Texas Travesty, the largest college humor publication in the nation, outrages a cult following of over 90,000 readers. The loud, lewd and utterly inappropriate Texas Travesty is published once in the summer and three times each spring and fall semester in print and on the Web at <a href="http://www.texastravesty.com" target="_blank">www.TexasTravesty.com</a>.', 'Media - Print - Travesty - Left', '', 'inherit', 'closed', 'closed', '', '328-revision-5', '', '', '2010-06-11 09:00:58', '2010-06-11 14:00:58', '', 328, 'http://dustinyounse.com/uncategorized/328-revision-5/', 0, 'revision', '', 0),
