(1122, 2, '2010-06-11 09:18:09', '2010-06-11 14:18:09', '<h1>Travesty</h1>\r\nThe Official Humor Publication of the University of Texas available online. Find all the stories and humor available in the publication at\r\n\r\n<a href="http://www.texastravesty.com/" target="_blank">http://www.texastravesty.com/</a>', 'Media - Online - Travesty - Left', '', 'inherit', 'closed', 'closed', '', '369-revision-6', '', '', '2010-06-11 09:18:09', '2010-06-11 14:18:09', '', 369, 'http://dustinyounse.com/uncategorized/369-revision-6/', 0, 'revision', '', 0),
(1123, 2, '2010-06-11 09:19:40', '2010-06-11 14:19:40', '<h1>Our Campus</h1>\r\nhere is so much impressive news to report about The University of Texas at Austin, a small, disproportionately educated town within Austin. Our Campus serves the community of 20,000 faculty and staff members in UT-town. It is their ingenious work in various supporting roles that makes this one of the best universities in the country. Visit Our Campus online to read all the featured stories.\r\n\r\n<a href="http://www.insideourcampus.com/" target="_blank">http://www.insideourcampus.com/</a>', 'Media - Online - Our Campus - Left', '', 'inherit', 'closed', 'closed', '', '365-revision-5', '', '', '2010-06-11 09:19:40', '2010-06-11 14:19:40', '', 365, 'http://dustinyounse.com/uncategorized/365-revision-5/', 0, 'revision', '', 0),
(1124, 2, '2010-06-11 09:16:49', '2010-06-11 14:16:49', '<h1>Texas Student Television</h1>\r\nTexas Student Television is the only student-run, student-produced, FCC-licensed college television station in the country. Students can learn camerawork, directing, producing, writing, and much more. Working with a broadcast adviser, the student staff makes all decisions about programming, use of equipment, marketing, outside production projects and the direction of the station.\r\n<br />\r\n<a href="http://www.texasstudenttv.com/" target="_blank">http://www.texasstudenttv.com/</a>', 'Media - Online - Texas Student Television - Left', '', 'inherit', 'closed', 'closed', '', '373-revision-7', '', '', '2010-06-11 09:16:49', '2010-06-11 14:16:49', '', 373, 'http://dustinyounse.com/uncategorized/373-revision-7/', 0, 'revision', '', 0);
