believed that "Texas Student Media" will much more accurately represent the full extent of the organization''s services.', 'About - Bottom', '', 'inherit', 'closed', 'closed', '', '858-revision-3', '', '', '2010-06-14 22:30:29', '2010-06-15 03:30:29', '', 858, 'http://dustinyounse.com/uncategorized/858-revision-3/', 0, 'revision', '', 0),
